import './calci.css'

function Calci() {
    let a=document.getElementById('one').innerHTML;
    let b=document.getElementById('two').innerHTML;
    let c=a+b;
    document.getElementById('button').onclick=function() {
        document.getElementById('result').innerHTML=c;
    }
    return(
    <>
    <div className="main">
        <h2 align='center'>SUM OF TWO NUMBERS...</h2>
        <div className="cc">
            <div className="calculator">
                <input type="text" name="" id="one" placeholder='0'/>
                <input type="text" name="" id="two" placeholder='0'/>
                <button id="button">RESULT</button>
                <input type="text" name="" id="result" placeholder='0'/>    
            </div>
        </div>
       
    </div>
       
    </>
        
    )
}

export default Calci;
